import React, { Component } from 'react'
import { Text, View } from 'react-native';

const variasDisci = (props) => {
    return(
        <View style = {{alignItems:'center'}}>
             <View style = {{alignItems:'center'}}>
                <Text > Minhas Disciplinas: {props.disciplina}!</Text>
            </View>
        </View>
    );
}


export default class Disciplina extends Component {
    render(){
        return(
            <View style = {{alignItems:'center'}}>
                <variasDisci disciplina = 'Mobile'/>
                <variasDisci disciplina = 'Design Inovação'/>
                <Disciplinas disciplina = 'CDP'/>
            </View>
        );
    }
}
